    false,nt"url": null,nt"notes": "Unexploded ordnance (or UXOs/UXBs, sometimes
    identified as UO) are explosive weapons (bombs, bullets, shells, grenades, land
    mines, naval mines, etc.) that did not explode when they were employed and still
    pose a risk of detonation, potentially many decades after they were used or discarded.
    While "UXO" is widely and informally used, munitions and explosives of concern
    (MEC) is the current preferred terminology within the remediation community. This
    is NOT a complete collection of unexploded ordnance on the seafloor, nor are the
    locations to be considered exact. The presence and locations of the unexploded ordnance
    have been derived from graphical representations recorded on NOAA Raster Navigation
    Charts. These data are intended for coastal and ocean planning. Not for navigation.",nt"license_title":
